import React from 'react'
import { Link } from 'react-router-dom'

const MainPage = () =>{
    return (
        <div>
        <h3>Hello im in the index page</h3>
        <Link to="/add"> 
          <img src="logo.svg" alt="Smiley face" height="42" width="42" />
        </Link>
        </div>
    );
  }

export default MainPage;
